The syntax for having an interface being a function is: 

```
interface whatever {
    (arg: type): returnType;
}
```

Not: 

```
interface whatever {
    function (arg: type): returnType;
}
```

If splitting the config into seperate files, this constructor overload is useful. For example, you might need a RoutesConfig.ts file. I have tested this on a project and Angular correctly accepts object references so we just need to update the type definition now.
#### Example
##### RoutesConfig.ts

```
export class RoutesConfig {

    static $inject = ['$stateProvider', '$urlRouterProvider', '$locationProvider'];

    constructor (private $stateProvider: angular.ui.IStateProvider, private $urlRouterProvider: angular.ui.IUrlRouterProvider, private $locationProvider: ng.ILocationProvider) {

        // Unmatched URLs, redirect to root
        $urlRouterProvider.otherwise('/');

        $stateProvider
            .state('home', {
                url: '/',
                template: '<route-home></route-home>'
            });

        $locationProvider.html5Mode(true);        
    }
}
```
##### Main.ts

```
import {RoutesConfig} from './common/RoutesConfig';
angular.module('myApp', [])
    .config(RoutesConfig)
```

In express.d.ts the `next` function in `RequestHandler` and `ErrorRequestHandler` was simply defined as `Function`. This PR is to define `next` function precisely.

According to Express document, there are three use cases of `next()`:

``` js
next();
next(err);
next('route');
```

When importing the `ReduxRouter`:

```
/// <reference path="../../interfaces/interfaces.d.ts" />

import * as React from 'react';
import { Provider } from 'react-redux';
import { ReduxRouter } from 'redux-router';
import configureStore from "../../store/configureStore.ts";

const store = configureStore();

class Root extends React.Component<any,any> {

  constructor(props) {
    super(props);
  }

  render() {
    return (
      <Provider store={store}>
        <ReduxRouter />
      </Provider>
    )
  }
}

export default Root;
```

There was a compilation error on `<ReduxRouter />` because `ReactRouter` is not a JSX element and has no render method.

This was caused because original file contained:

```
/**
* A component that renders a React Router app using router state from a Redux store.
*/
export class ReactRouter { }
```

The exported `ReactRouter` class is empty but it is supposed to be the `ReactRouter`. 

I removed the empty class and exported the the `ReactRouter` instead:

```
declare module "redux-router/lib/ReduxRouter" {
    import Router from "react-router";
    export default Router;
}
```
